import React from 'react'
import { FaGithub, FaReact } from 'react-icons/fa6'

export default function Icon( { icon, size='1.5rem', color='black' }) {

    let iconName;

    switch (icon) {
        case 'FaGithub':
            iconName = FaGithub
            break
        default:
            iconName = FaReact
    }

    return <iconName size={size} color={color} />
}
